import React, { Component } from 'react';
import { Container, Jumbotron } from 'react-bootstrap';
import NavBar from './components/NavBar';

class App extends Component {
  state = {};

  componentDidMount() {
    axios
      .get(
        'http://api.giphy.com/v1/gifs/trending?api_key=hG42aWITrkOlgZ0fzJJd6ywB58ssixa7'
      )
      .then((res) => {
        this.setState({
          gifs: res.data.data,
        });
      })
      .catch((error) => {
        console.log('Error fetching and parsing data', error);
      });
  }

  render() {
    return (
      <div>
        <NavBar />
        <Jumbotron>
          <Container>
            <h1>Best Bank</h1>
          </Container>
        </Jumbotron>
        <Container className="container border border-white rounded rounded-sm bg-white pt-4">
          <h1>Expected returns</h1>
        </Container>
      </div>
    );
  }
}

export default App;
